    <div className="App">

      <Router>
          <Navbar />
          <Routes>
            
            <Route path='/' element={<Home />} />
            {/*product'ta onclick yazdık tıklandıgında, id url atıyor dinamik olarak, id gore yonlendirme yapıyor? */}
         

